			<NumPad>
				<NumKey>7</NumKey>
				<NumKey>8</NumKey>
				<NumKey>9</NumKey>
				<NumKey>4</NumKey>
				<NumKey>5</NumKey>
				<NumKey>6</NumKey>
				<NumKey>1</NumKey>
				<NumKey>2</NumKey>
				<NumKey>3</NumKey>
			</NumPad>
		</Container>
	);
};

export default Calculator;
